Here is a simple Python function that does a case-insensitive sort of a list of strings:

```python
def case_insensitive_sort(lst):
    return sorted(lst, key=lambda s: s.lower())
```

This function uses the `sorted` built-in function with a custom `key` argument that converts each string to lowercase before comparing them. This ensures that strings are sorted in a case-insensitive manner.
